-- 导出  表 chainmaker_dev.cmb_block 结构
CREATE TABLE IF NOT EXISTS `cmb_block` (
  `id` bigint NOT NULL AUTO_INCREMENT,
  `create_at` datetime DEFAULT NULL,
  `update_at` datetime DEFAULT NULL,
  `pre_block_hash` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `chain_id` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `block_hash` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `block_height` bigint unsigned DEFAULT NULL,
  `org_id` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `timestamp` bigint DEFAULT NULL,
  `dag_hash` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `tx_count` int DEFAULT NULL,
  `rw_set_hash` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `tx_root_hash` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `proposer` longtext COLLATE utf8mb4_general_ci,
  `proposer_type` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `consensus_args` longtext COLLATE utf8mb4_general_ci,
  `proposer_id` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  `addr` varchar(255) COLLATE utf8mb4_general_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `chain_id_block_height_index` (`chain_id`,`block_height`),
  KEY `chain_id_block_hash_index` (`chain_id`,`block_hash`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci;

